0px 0px 24px 2px;" times="" new="" roman",="" times,="" serif;"=""><b style="color: rgb(90, 69, 53);">The doctor should have a proper knowledge of the treatment method.</b><br><font color="#5a4535">Narrated by Hazrat Aamir Bin Shuaib رضي الله عنه that Nabi ﷺ said "Whoever gives medical treatment with no prior knowledge of medicine will be responsible (for any harm done).&nbsp;</font><font color="#ff0000" style="">This Hadith is graded as Da-if (zaif) by Darussalam.</font><br><b style="color: rgb(90, 69, 53);">[Ibn Majah: 3466; Book. 31; Eng vol. 4; chapter. 31; Hadees. 3466]</b><br><font color="#5a4535">Allah Talah says in Chapter 2 (Sura) Baqarah verse no 269 that I (Allah) teach Hikmat (treatment) to whom, he is made to benefit the poeple greatly.</font></p><p style="text-align: center; font-size: 15px; line-height: 30px; margin-bottom: 0px; padding: 0px 0px 24px 2px;" times="" new="" roman",="" times,="" serif;"=""><span style="font-size: 24px;">یُؤْتِی الْحِکْمَۃَ مَنْ یَّشَاۗءُ۝۰ۚ وَمَنْ یُّؤْتَ الْحِکْمَۃَ فَقَدْ اُوْتِیَ 
خَیْرًا کَثِیْرًا۝۰ۭ وَمَا یَذَّکَّرُ اِلَّآ اُولُوا الْاَلْبَابِ۝۲۶۹</span>&nbsp;<font color="#5a4535"><br></font></p><h3 style="color: rgb(0, 0, 0); font-family: " times="" new="" roman",="" times,="" serif;"=""><font color="#003192">Scientific examples:</font></h3><p style="color: rgb(90, 69, 53); font-size: 15px; line-height: 30px; margin-bottom: 0px; padding: 0px 0px 24px 2px; font-family: " times="" new="" roman",="" times,="" serif;"=""><b>Eating and doing things with right hand:</b><br>Let"s see if science helps us to find any answer to why Muslims are asked to use their right hand more than the other. What could be the wisdom behind this?<br>Nabi ﷺ ate using his right hand fingers and licked his fingers after meals:<br>A new scientific research has proven that our hands (especially the right hand) have enzymes that are also present in our saliva. In simpler words, the digestive process actually begins with our fingers as they break down the food that we eat. A simple method to see the effects of our hands on digestive process are as follows:<br>1. Take 2 bowls filled with plain water, now put right hand in one bowl &amp; left hand in other for sometime &amp; see for any changes in the water, you will see some water changes in both the bowls but more in right hand bowl, these changes are due to digestive enzymes present on our fingers.<br>2. Now put some vegetables in both the bowls, &amp; again dip the right &amp; left hand in each bowl for sometime and see the changes on the vegetables, you will see that the vegetables gets softer more in right hand bowl means that our right hand has more active enzyme than left, so it is sunnah to eat with right hand.<br>3. These enzymes help the digestive process &amp; if we eat with spoon (etc) we lose the opportunity of the enzymes present on right fingers.<br>4. Also it is believed &amp; proved that licking of right fingers after meals are good &amp; beneficial for digestion &amp; remember it is Sunnah. And it is a well known proverb (saying) "fingers licking are good!".</p><h3 style="color: rgb(0, 0, 0); font-family: " times="" new="" roman",="" times,="" serif;"=""><font color="#003192">About Brain:</font></h3><p style="color: rgb(90, 69, 53); font-size: 15px; line-height: 30px; margin-bottom: 0px; padding: 0px 0px 24px 2px; font-family: " times="" new="" roman",="" times,="" serif;"="">As we know that science tells us that when we do exercise, it helps in keeping our body healthy. There are different types of exercises for every part of the body and if done over and over again, keeps that part more functional. Same goes with brain exercises, when you do them over and over again they help in developing connections in the brain. As there are two main lobes of the brain (Right and left).<br>According ot a research "The concept of right brain and left brain, thinking developed" that took place in the late 1960, by an American psycho biologist "Roger W Sperry". He discovered that the human brain has two very different ways of thinking (functioning).<br>Please remember that the left lobe of brain acts on the movement of right side of the body &amp; right lobe of brain acts on the movement of left side of the body (This is called as criss-cross system).</p><h3 style="color: rgb(0, 0, 0); font-family: " times="" new="" roman",="" times,="" serif;"=""><font color="#003192">Right Side Brain:</font></h3><p style="color: rgb(90, 69, 53); font-size: 15px; line-height: 30px; margin-bottom: 0px; padding: 0px 0px 24px 2px; font-family: " times="" new="" roman",="" times,="" serif;"=""><b>The right brain visualizes and processes information in an intuitive and simultaneous way, looking first at the whole picture &amp; then the details. The right brain is referred to as the analog brain. It controls three-dimensional sense, creativity, and artistic senses to allow us to function as humans.</b><br>Means the right side brain is more active in imaginations (means to form a picture in the mind) about things or information in intuitive way (means instant understanding or inspirations without actual thinking) both functions takes place at the same time. The right hemisphere is mainly in charge of spatial abilities (means doing work in steps), face recognition and processing music. It performs some moths, but only rough estimations and comparisons. The right brain also helps us to comprehend visual imagery and make sense of what we see. It plays an important role in language, particularly in interpreting context and a person"s tone.</p><h3 style="color: rgb(0, 0, 0); font-family: " times="" new="" roman",="" times,="" serif;"=""><font color="#003192">Left Side Brain:</font></h3><p style="color: rgb(90, 69, 53); font-size: 15px; line-height: 30px; margin-bottom: 0px; padding: 0px 0px 24px 2px; font-family: " times="" new="" roman",="" times,="" serif;"="">The left brain verbalizes and processes information in an analytical and sequential ways, looking first at the pieces then putting them together to get the whole. Sperry was awarded a Nobel prize in 1981, although subsequent researches had shown things are not quite as polarized as once thought (nor as simple).<br>Left brain is also referred to as Digital brain. It controls reading and writing, calculation, and logical thinking. Means left brain is more active in expressing things in words and processes information by analyzing &amp; examining work or things in proper order and do the work in regular way.<br>In general, the left hemisphere is dominant in language: processing what you hear and handling most of the duties of speaking. its also in charge of carrying out logic and exact mathematical computations. When you need to retrieve a fact, your left brain pulls it from your memory.</p><p style="color: rgb(90, 69, 53); font-size: 15px; line-height: 30px; margin-bottom: 0px; padding: 0px 0px 24px 2px; font-family: " times="" new="" roman",="" times,="" serif;"=""><img src="data:image/png;base64," style="width: 507px;" data-filename="image.png"><br></p><p style="color: rgb(90, 69, 53); font-size: 15px; line-height: 30px; margin-bottom: 0px; padding: 0px 0px 24px 2px; font-family: " times="" new="" roman",="" times,="" serif;"="">The brain"s right hemisphere controls the muscles on the left side of the body, while the left hemisphere controls the muscles on the right side of the human body. When we blink the right eye, we use the left side of the brain of the criss-cross wiring &amp; due to this criss-cross wiring damage to one side of the brain affects the opposite side of the body.</p><p style="color: rgb(90, 69, 53); font-size: 15px; line-height: 30px; margin-bottom: 0px; padding: 0px 0px 24px 2px; font-family: " times="" new="" roman",="" times,="" serif;"=""><img src="data:image/png;base64," style="width: 359px;" data-filename="image.png"><br></p><p style="color: rgb(90, 69, 53); font-size: 15px; line-height: 30px; margin-bottom: 0px; padding: 0px 0px 24px 2px; font-family: " times="" new="" roman",="" times,="" serif;"="">So to conclude when we use more the right hand it gives more exercises to left side of the brain making it &amp; its functions stronger &amp; eating &amp; etc is Sunnah with right hand. And remember we use both hands equally while offering Salah. This is beauty of Sunnah of our Nabi ﷺ.<br>And it is Sunnah of Nabi ﷺ to start a good work with right hand by this we activate the left side brain &amp; left side of brain is more active &amp; powerful in analysis, logical thinking, doing work in proper order in regular way &amp; etc. So by starting a good work by right hand or right leg helps us in positive response of brain.<br>The right handed person use their left side brain more and left handed person use their right side of the brain more, so right handed person are more logical, linear, good at math"s, calculation, language learning, good at words, do things inorder in regular way by mostly analyzing the work better, has good hand writing.<br>The left handed person are more creative, think holistic (means taking in consideration of all aspects), good at arts &amp; work skills, better in visualizing, rhythmic, have mostly bad hand writing &amp; work step by step.<br></p><h3 style="color: rgb(0, 0, 0); font-family: " times="" new="" roman",="" times,="" serif;"=""><font color="#003192">Medical Guidance &amp; Teachings of Nabi ﷺ</font></h3><p style="color: rgb(90, 69, 53); font-size: 15px; line-height: 30px; margin-bottom: 0px; padding: 0px 0px 24px 2px; font-family: " times="" new="" roman",="" times,="" serif;"="">Medical guidance &amp; teachings of Nabi ﷺ was &amp; is neglected by us, we perform many Sunnah of our Nabi ﷺ except Sunnah of treatment, eating &amp; uses of food products as treatment. Sahabah paid a lot of importance to medical Sunnah of Nabi ﷺ, &amp; learnt, taught &amp; performed the respected Sunnah.<br>Allah Ta"ala had taught principles of treatment to our Nabi ﷺ, for the whole world, but we do not learn them nor perform them. It is not like this, that we do not believe on them but we do not pay importance to them, nor do we know them. Sahabah were very well versed with medical Sunnah of Nabi ﷺ &amp; perform them &amp; got great success in treating themselves and others.<br>This science is called as Tibb-e-nabawi ﷺ there are beautiful descriptions &amp; guidance about diseases, to which modern medical science has yet not understood &amp; discovered.<br>Dear respected READERS! we should make these Sunnah of treatment alive, as they very well deserve to be. These Sunnah are forgotten &amp; neglected ones, to which we need to bring awareness. The reward for this work will be unimaginable.<br>Sahabah learnt these Sunnah very well, and did people coming after Sahabah &amp; so on, but in between we forgot these Sunnah &amp; today our generation is very far from these. Please join the mission of making these Sunnah alive so that WE all will be benefited, as Sahabah use to get Nabi ﷺ &amp; Sahabah used these Sunnah of treatment, &amp; the patients use to get well immediately or sooner than what we do in todays era.</p><p></p>
